import axios from 'axios';

let BASE_API_URL = 'localhost:9080'

export const loginUser = (pEmail, pPassword) => {
    console.log(email, password)
    var response = axios.post(`${BASE_API_URL}/v1/users/login`, {
        email: pEmail,
        password: pPassword
    }, 
    {
        headers: {
           // 'x-access-token': '',
            'Content-Type': 'application/x-www-form-urlencoded'
        },
        json: true
    });

    return response;
};

